def getUserData(_id):
    user_data = pd.read_csv('./user.csv')
    _ids=list(user_data["_id"])
    for index,value in enumerate(_ids):
        if(str(value)==_id) :
            user_data= { 
                'name': list(user_data['name'])[index], 
                "phoneNumber": list(user_data['phoneNumber'])[index]
            }
            return user_data
    return "0"

