@app.route('/get_contact_data' , methods=['POST'])
def get_contact_data():
    request_data = request.get_json()
    _id=request_data["_id"]
    length=0
    contacts=[]
    with open('./'+_id+'/contact.csv', 'r', newline='\n') as csvfile:
        rows = list(csv.reader(csvfile))
        for row in rows[1:]:
            contacts.append({
                "_id":row[0],
                "name":row[1],
                "phoneNumber":row[2],
                'password':row[3],
                'sex':row[5],
                'lastDialog':row[6]
            })
        print(rows)
        length=len(rows[1:])
    data={"length":length,"contacts":contacts}
    print(data)
    return jsonify({"data":data})

@app.route('/get_dialog_data' , methods=['POST'])
def get_dialog_data():
    request_data = request.get_json()
    _id=request_data["_id"]
    contact_id=str(request_data["contact_id"])
    length=0
    dialogs=[]
    with open('./'+_id+'/'+contact_id+'.csv', 'r', newline='\n') as csvfile:
        rows = list(csv.reader(csvfile))
        for row in rows[1:]:
            dialogs.append({
                "time":row[0],
                "from":row[1],
                "text":row[2]
            })
        print(rows)
        length=len(rows[1:])
    data={"length":length,"dialogs":dialogs}
    print(data)
    return jsonify({"data":data})

